import iconsMeta from './icons-meta';

export default {
  name: 'icons',
  data() {
    return {
      iconMap: [],
    };
  },
  mounted() {
    const iconMap = iconsMeta.iconMap.map((svg) => {
      const result = svg.default.id.split('-')[1];
      return result;
    });
    this.iconMap = iconMap;
  },
};
